import Navbar from '../../common/navbar/Navbar';
import styles from '../profile.module.scss';
import { Stepper } from 'react-form-stepper';
import Upload from '../../common/upload/Upload';

import Cookies from 'universal-cookie';
import { useState } from 'react';
const cookies = new Cookies();

function Two()  {

    const [idnumber, setIdnumber] = useState('');
    const [name, setName] = useState('');
    const [address, setAddress] = useState('');
    const [city, setCity] = useState('');
    const [country, setCountry] = useState('');
    const [zipcode, setZipcode] = useState('');
    const [gender, setGender] = useState('');
    const [height, setHeight] = useState('');
    const [weight, setWeight] = useState('');

    const onSubmit = () => {
        let oneObj = cookies.get('pilot');

        let certificate = {
            idnumber,
            name,
            address,
            city,
            country,
            zipcode,
            gender,
            height,
            weight
        }

        oneObj.certificate = certificate;

        cookies.set('pilot', oneObj);
        console.log('pilot', cookies.get('pilot')); // Pacman

        window.location="/profile/farm/3"
    }

    return (
        <>
            <Navbar />
            <div className={styles['container']}>
                <div>

                <Stepper 
                    steps={[{}, {}, {}, {}]}
                    activeStep={1}
                />
                <div className={styles['form-title']}>
                    Let's verify your pilot certification.
                </div>
                <div className={styles['form-subtitle']}>
                    Fill in more data regarding your pilot certification.
                </div>

                <div className={styles['form-body']}>
                    <div className={styles['form-title']}>
                        Remote Pilot Certificate
                    </div>
                    <div className={styles['input-field']}>
                        <input type="text" placeholder="Certificate ID number" />
                    </div>
                    <div className={styles['input-field']}>
                        <input type="text" placeholder="Name of Certificate Holder" />
                    </div>
                    <div className={styles['input-field']}>
                        <input type="text" placeholder="Address" />
                    </div>
                    <div className={styles['input-field']}>
                        <input type="text" placeholder="City" />
                    </div>

                    <div className={styles['row']}>
                        <div className={styles['input-field']}>
                            <input type="text" placeholder="Country" />
                        </div>
                        <div className={styles['input-field']}>
                            <input type="text" placeholder="Zip Code" />
                        </div>
                    </div>

                    <div className={styles['input-field']}>
                        <input type="text" placeholder="Gender" />
                    </div>

                    <div className={styles['row']}>

                        <div className={styles['input-field']}>
                            <input type="text" placeholder="Height" />
                        </div>
                        <div className={styles['input-field']}>
                            <input type="text" placeholder="Weight" />
                        </div>
                    </div>

                </div>

                {/* <Upload text={'Upload pdf/image of certificate'} /> */}

                <div className={styles['navigate']}>
                    <div className={styles['navigate-btn']}>
                        <button className={styles['grey']}>Back</button>
                    </div>
                    <div className={styles['navigate-btn']}>
                        <button className={styles['blue']} style={{cursor: "pointer"}} onClick={() => window.location="/profile/pilot/3"}>Next</button>
                    </div>
                </div>
                </div>
            </div>
        </>
    )
}

export default Two;
